import React from 'react'
import {Link} from 'react-router-dom'

import {post} from '../../utils/request.js'
import history from '../../utils/history'
import './AddOne.css'

class Drawer extends React.Component{
    constructor() {
        super();
    }

    render() {
        return(
            <div className="drawer-container">

            </div>
        )
    }
}

export default class AddOne extends React.Component{
    constructor() {
        super();
    }

    componentDidMount() {
    }
    back(){
        history.goBack()
    }
    save(){
        let data = {
            amount: 1000,
            category: "food",
            type: 0,
            time: "2021.7",
            remark: "火锅",
        }
        post('add', data).then( (res) => {
            console.log(res);
        })
    }

    render() {
        return(
            <div className="container">
                <div className="add-title">
                    <button className="back-btn" onClick={this.back}>
                        <svg className="icon svg-back" aria-hidden="true">
                            <use xlinkHref="#icon-back" />
                        </svg>
                    </button>
                    <div>记一笔</div>
                </div>
                <div className="add-detail">
                    <div>
                        <label>支出</label><input className="input-amount"/>
                    </div>
                    <div>
                        <svg className="icon svg-category" aria-hidden="true">
                            <use xlinkHref="#icon-category" />
                        </svg>
                        <label>类别</label>
                        <section>
                            <option>食物</option>
                        </section>
                    </div>
                    <div>
                        <svg className="icon svg-date" aria-hidden="true">
                            <use xlinkHref="#icon-date" />
                        </svg>
                        <span>时间</span>
                    </div>
                    <div>
                        <svg className="icon svg-remark" aria-hidden="true">
                            <use xlinkHref="#icon-remark" />
                        </svg>
                        <span>备注</span>
                        <input/>
                    </div>
                </div>
                <div>
                    <button onClick={this.save}>保存</button>
                </div>
            </div>
        )
    }
}
